import React from 'react';
import { Line } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend } from 'chart.js';

// Registrar los componentes de ChartJS
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

const TestDetails = ({ testData }) => {
  if (!testData || !testData.data || !testData.pascon) {
    return <div>No hay datos disponibles para este test.</div>;
  }

  // Obtener los datos de SPO2 y HR del test
  const timeValues = testData.data.map((entry) => entry.t);
  const spoValues = testData.data.map((entry) => entry.s);
  const hrValues = testData.data.map((entry) => entry.h);

  // Obtener los datos de los checkpoints
  const checkpointTimes = testData.pascon.map((entry) => entry.t);
  const checkpointSpo = testData.pascon.map((entry) => entry.s);
  const checkpointHr = testData.pascon.map((entry) => entry.h);

  // Configurar los datos para el gráfico de SPO2 y HR
  const spo2HrData = {
    labels: timeValues,
    datasets: [
      {
        label: 'SPO2',
        data: spoValues,
        borderColor: 'blue',
        backgroundColor: 'rgba(54, 162, 235, 0.2)',
        fill: false,
      },
      {
        label: 'Heart Rate',
        data: hrValues,
        borderColor: 'red',
        backgroundColor: 'rgba(255, 99, 132, 0.2)',
        fill: false,
      },
    ],
  };

  // Configurar los datos para el gráfico de checkpoints
  const checkpointData = {
    labels: checkpointTimes,
    datasets: [
      {
        label: 'Checkpoint SPO2',
        data: checkpointSpo,
        borderColor: 'blue',
        backgroundColor: 'rgba(54, 162, 235, 0.2)',
        fill: false,
        pointStyle: 'circle',
        pointRadius: 5,
      },
      {
        label: 'Checkpoint HR',
        data: checkpointHr,
        borderColor: 'red',
        backgroundColor: 'rgba(255, 99, 132, 0.2)',
        fill: false,
        pointStyle: 'circle',
        pointRadius: 5,
      },
    ],
  };

  // Opciones comunes para los gráficos
  const options = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'SPO2 and Heart Rate over Time',
      },
    },
  };

  return (
    <div>
      <h2>Test Details</h2>

      {/* Gráfico de Checkpoints */}
      <div>
        <h3>Checkpoints Graph</h3>
        <Line data={checkpointData} options={options} />
      </div>

      {/* Gráfico de SPO2 y HR */}
      <div>
        <h3>SPO2 and Heart Rate</h3>
        <Line data={spo2HrData} options={options} />
      </div>

      {/* Detalles del Test */}
      <div>
        <h3>General Test Data</h3>
        <p>O2 Prescribed: {testData.test.o2 || 'No existeix'}</p>
        <p>Patient ID: {testData.test.pid || 'No existeix'}</p>
        <p>Doctor ID: {testData.test.did || 'No existeix'}</p>
        <p>Pulsioxímetre ID: {testData.test.pulsid || 'No existeix'}</p>

        <h3>Initial Basals</h3>
        <p>Saturation (spo): {testData.initial.spo || 'No existeix'}</p>
        <p>Heart Rate (hr): {testData.initial.hr || 'No existeix'}</p>
        <p>Dispnea (d): {testData.initial.d || 'No existeix'}</p>
        <p>Fatiga (f): {testData.initial.f || 'No existeix'}</p>

        <h3>Final Values</h3>
        <p>Meters Walked: {testData.final.meters || 'No existeix'} mts</p>
        <p>Dispnea (d): {testData.final.d || 'No existeix'}</p>
        <p>Fatiga (f): {testData.final.f || 'No existeix'}</p>
        <p>Final Rest SPO2: {testData.final.end_rest_spo || 'No existeix'}</p>
        <p>Final Rest HR: {testData.final.end_rest_hr || 'No existeix'}</p>
        <p>Comments: {testData.final.comments || 'No existeix'}</p>

        <h3>Passes to the Cone</h3>
        {testData.pascon.length > 0 ? (
          testData.pascon.map((cone, index) => (
            <p key={index}>Pass {cone.n}: Time {cone.t} s, Saturation {cone.s}, HR {cone.h}</p>
          ))
        ) : (
          <p>No existeix</p>
        )}

        <h3>Stops</h3>
        {testData.stops.length > 0 ? (
          testData.stops.map((stop, index) => (
            <p key={index}>Stop {stop.n}: Duration {stop.duration} s</p>
          ))
        ) : (
          <p>No existeix</p>
        )}
      </div>
    </div>
  );
};

export default TestDetails;
